webpackJsonp([112],{615:function(n,e){n.exports="# action-sheet.js\n\n`{ ActionSheet, ActionRadioGroup }`\n\n## ActionSheet\n\n弹出动作列表。\n\n### API\n\n| props | 说明 | 类型 | 默认值 | 必需 | \n|:--|:--|:--|:--|:--|\n| show | 是否显示 | Boolean | false | 是 |\n| data | 列表数据 | \\[ReactNode\\] | \\[\\] | |\n| cancelLabel | 取消按钮文本 | ReactNode | '取消' | |\n| onChange | 变更回调 | (Number, Event) => {} | | |\n| onCancel | 取消回调 | Event => {} | | |\n| renderSheet | 列表渲染函数 | (data, onChange) => ReactNode | renderList | |\n\n默认 ActionSheet 会渲染成列表形式，开发者可以通过 `renderSheet` 自定义渲染形式。\n\n## ActionRadioGroup\n\n单选列表形式的弹出动作列表。已选择的选项后面会有单选标记。\n\n### API\n\n| props | 说明 | 类型 | 默认值 | 必需 | \n|:--|:--|:--|:--|:--|\n| show | 是否显示 | Boolean | false | 是 |\n| data | 列表数据 | \\[{ value: objectKeyProp, label: ReactNode, disabled: Boolean }\\] | \\[\\] | |\n| cancelLabel | 取消按钮文本 | ReactNode | '取消' | |\n| onChange | 改变回调 | (objectKeyProp, Event) => {} | | |\n| onCancel | 取消回调 | Event => {} | | |\n| value | 当前选择值 | objectKeyProp | | |\n\n"}});